import {SocialItems} from "./Socials";
import style from './style/footer.css';
//


export default function Index(props){
    return(
        <section className="Footer">
            <style jsx>{style}</style>
            <style jsx>{`.fb_icon{
    background-image: url('./images/icons/discordia.png');
}
.tw_icon{
    background-image: url('./images/icons/twitter.png');
}
.ig_icon{
    background-image: url('./images/icons/instagram.png');
}
.dc_icon{
    background-image: url('./images/icons/discordia.png');
}
.yt_icon{
    background-image: url('./images/icons/youtube.png');
}`}</style>
                <div>
                    <ul className="social">
                        {SocialItems.map((item, index) => {
                            return(
                                <li key={index}>
                                    <a href={item.url} className={item.cName}>
                                        <div className={item.cIcon}></div>
                                    </a>
                                </li>
                            )
                        })}
                    </ul>
                    <hr className="line_1"></hr>
                    <p className="copyright">©2020 diseñado y programado por Neodoom Xardax.</p>
                </div>
        </section>
    );
}
